import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  flex:1;
  background-color: #202020;
  height:100vh;
`;

//   height:5vh mane holo ei component total jottuk space pae tar 5% nibe.. ekhane 00vh mane puratai nibe

const Wrapper = styled.div`
  padding:18ps 26px;
  background-color: #dae0da
  ;
`;

const Menu = () => {
  return (
    <Container>
      <Wrapper>
        Items
      </Wrapper>
    </Container>
  )
}

export default Menu
